import ReactPlayer from 'react-player';
import "../Style/Video.css"

function VideoSender(props) {
    return (
        <div className="videoContainer sender">
            <ReactPlayer className="video" url={props.url} controls muted />
        </div>
    )
}

function VideoRecipient(props) {
    return (
        <div className="videoContainer recipient">
            <ReactPlayer className="video" url={props.url} controls muted />
        </div>
    )
}

export default function Video(props) {
    if (props.sender && !props.senderHide) {
        return (
          <MessageFileSender
            key={Math.random() * (9999999999 - 0)}
            filename={props.filename}
            size={props.size}
            mimetype={props.mimetype}
            name={props.name}
            type={props.type}
          />
        );
      } else if (!props.sender && !props.recipientHide && !props.senderHide) {
        return (
          <MessageFileRecipient
            key={Math.random() * (9999999999 - 0)}
            filename={props.filename}
            size={props.size}
            mimetype={props.mimetype}
            name={props.name}
            type={props.type}
          />
        );
      } else if (props.sender && props.senderHide) {
        return <MessageDeletedSender />;
      } else if (!props.sender && props.senderHide) {
        return <MessageDeletedRecipient />;
      }
}
